pragma solidity ^0.5.*;

contract SupplierInput{
    //states
    enum StateType {Accepted}
    

    StateType public State;
    address public Supplier;
    string public PartNumber;
    string public PartDescription;
    string public LocationCode;
    string public ImportCountry;
    string public EffectiveDate;
    
    //contstuctor
    constructor(string memory partdescription, string memory partnumber, string memory locationcode, string memory importcountry, string memory effectivedate) public{
        Supplier = msg.sender;
        PartDescription = partdescription;
        PartNumber = partnumber;
        LocationCode = locationcode;
        ImportCountry = importcountry;
        EffectiveDate = effectivedate;
    }

    function Accepted() public{}



}
